$(document).ready(function(){"use strict";const a='https://prize.africtivistes.org/api/count';$.ajax(a,{dataType:'json',success:function(a,b,c){for(let b=0;b<a.length;b++)$(`#${a[b].id} .progression-bar-inner-progress`).css('width',`${a[b].count}%`),$(`#${a[b].id} .progression-bar-val`).html(`${a[b].count}%`)}})})